import React, { useState } from "react";
import styles from "./App.module.css";
import Header from "./Header";
import Navbar from "./Navbar";

const MainPage = () => {
  const [isNavbarOpen, setIsNavbarOpen] = useState(false);

  const toggleNavbar = () => {
    setIsNavbarOpen(!isNavbarOpen);
  };

  const closeNavbar = () => {
    setIsNavbarOpen(false);
  };

  return (
    <div className={styles.container} onClick={closeNavbar}>
      <Header />
      <button className={styles.menuButton} onClick={(e) => { e.stopPropagation(); toggleNavbar(); }}>
        â˜° Menu
      </button>
      <Navbar isOpen={isNavbarOpen} closeNavbar={closeNavbar} />
      <main className={styles.mainContent}>
        <h2>Welcome to the Main Page</h2>
        <p>This is a sample layout with Header and Navbar components.</p>
      </main>
    </div>
  );
};

export default MainPage;
